import React from 'react'
import { AppBar, Toolbar, Typography } from '@mui/material';
import InstagramIcon from '@mui/icons-material/Instagram';

const header = () => {
    return (
        <AppBar >
            <Toolbar >
                <InstagramIcon></InstagramIcon>
            </Toolbar>
        </AppBar>
    )
}

export default header
